  [],\n\t\"revision_timestamp\": \"2016-08-20T09:39:33.736259\",\n\t\"name\": \"tualatin-river-invasive-species-identification-control-and-monitoring\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Project goals were to train volunteers
  to conduct invasive species mapping using GPS and GIS technology. Volunteers were
  able to map 450 acres on the Atflati Unit of Tualatin River NWR. About 150 acres
  of invasive species were subsequently treated by either discing or by application
  of Service approved herbicide by refuge staff. We plan to continue next season by
  training more volunteers to conduct invasive species mapping and to form a \"hot
  shot\" team to combat the most aggressive species. In addition, staff will be analyzing
